  updateTabla() {
    let referencia = this.tablaForm.controls['referencia'].value;
    let asociacion = this.tablaForm.controls['asociacion'].value;
    let username = atob(localStorage.getItem('username')!);
    if (referencia == null || referencia == 'Referencia') {
      utils.showAlert('Por favor seleccione una referencia!', 'error');
      return;
    }
    if (asociacion == null || asociacion == 'Asociación') {
      utils.showAlert('Por favor seleccione una asociación!', 'error');
      return;
    }
    // alert(referencia+'---'+asociacion+'---'+this.myParam);
    this.secopService.updateTabla(referencia, asociacion, this.myParam, username).subscribe((response: any) => {
      if (response.Status == 'Ok') {
        utils.showAlert('Proceso actualizado correctamente!', 'success');
      }
    })
  }

  getPlazoDate(fecha: any) {
    let d = new Date(fecha);
    let dia = (d.getDate().toString().length == 1) ? '0' + d.getDate().toString() : d.getDate().toString();
    let mes = ((d.getMonth() + 1).toString().length == 1) ? '0' + (d.getMonth() + 1) : (d.getMonth() + 1);
    let anio = d.getFullYear();

    switch (mes) {
      case '01':
        mes = 'ENERO';
        break;
      case '02':
        mes = 'FEBRERO';
        break;
      case '03':
        mes = 'MARZO';
        break;
      case '04':
        mes = 'ABRIL';
        break;
      case '05':
        mes = 'MAYO';
        break;
      case '06':
        mes = 'JUNIO';
        break;
      case '07':
        mes = 'JULIO';
        break;
      case '08':
        mes = 'AGOSTO';
        break;
      case '09':
        mes = 'SEPTIEMBRE';
        break;
      case '10':
        mes = 'OCTUBRE';
        break;
      case '11':
        mes = 'NOVIEMBRE';
        break;
      case '12':
        mes = 'DICIEMBRE';
        break;
      default:
        break;
    }
    // let hora = (d.getHours().toString().length == 1) ? '0' + d.getHours().toString() : d.getHours().toString();
    // let minutos = (d.getMinutes().toString().length == 1) ? '0' + d.getMinutes().toString() : d.getMinutes().toString();
    return dia + ' DE ' + mes + ' DEL ' + anio;
  }

  getFirmaDate(fecha: any) {
    // alert(fecha)
    let d = new Date(fecha);
    let dia = (d.getDate().toString().length == 1) ? '0' + d.getDate().toString() : d.getDate().toString();
    let mes = ((d.getMonth() + 1).toString().length == 1) ? '0' + (d.getMonth() + 1) : (d.getMonth() + 1);
    let anio = d.getFullYear();
    switch (mes) {
      case '01':
        mes = 'ENERO';
        break;
      case '02':
        mes = 'FEBRERO';
        break;
      case '03':
        mes = 'MARZO';
        break;
      case '04':
        mes = 'ABRIL';
        break;
      case '05':
        mes = 'MAYO';
        break;
      case '06':
        mes = 'JUNIO';
        break;
      case '07':
        mes = 'JULIO';
        break;
      case '08':
        mes = 'AGOSTO';
        break;
      case '09':
        mes = 'SEPTIEMBRE';
        break;
      case '10':
        mes = 'OCTUBRE';
        break;
      case '11':
        mes = 'NOVIEMBRE';
        break;
      case '12':
        mes = 'DICIEMBRE';
        break;
      default:
        break;
    }
    return '(' + dia + ') dias de ' + mes.toString().toLowerCase() + ' de ' + anio + '.';
  }

